input.extraction_script:
function extractNavigation() {
  const results = [];

  // Find all navigation elements that are revealed when hovering over the shop menu
  const navSections = document.querySelectorAll('nav:has([href*="/collections"])');

  navSections.forEach(section => {
    const links = section.querySelectorAll('a[href*="/collections"]');
    links.forEach(link => {
      const name = link.textContent.trim();
      const url = link.href;

      if (name && url && name !== 'SHOP') {
        results.push({
          name: name,
          url: url,
          children: []
        });
      }
    });
  });

  return results;
}

